import React from 'react';
import PizzaCard from './PizzaCard'


const PizzaCardList = ({pizzas=[pizzas]}) => {
	const PizaComponent = ()=> {pizzas.map((pizza, i) => (<PizzaCard key={i} pizzas={pizzas}/>))}

  return (
  	<div className="AllSabores">
  	{PizaComponent()}
    </div>
  );
};

export default PizzaCardList;
